import DashboardContainer from '../components/dashboard';

function DashboardPage() {
  return (
    <div className="bg-gradient-to-b from-[#ffffff] to-[#e1f3fc] to-[66.346%] min-h-screen">
      <DashboardContainer />
    </div>
  );
}

export default DashboardPage;
